(window.webpackJsonp=window.webpackJsonp||[]).push([[263],{358:function(e){e.exports=JSON.parse('{"id":"version-5.2.x/implementations/openhie","title":"OpenHIE","description":"OpenHIE is an initiative that aims to provide a reference architecture and workflow specifications for sharing health information between point of care systems in low resource settings. It aims to be standards-based and open such that components of the architecture can be swapped out as is necessary. OpenHIE is made up of a number of sub-communities that each aim to discuss a particular component of the architecture. Each community maintains a reference implementation of their particular component.","source":"@site/versioned_docs/version-5.2.x/implementations/openhie.md","permalink":"/openhim-docs/docs/implementations/openhie","version":"5.2.x","sidebar_label":"OpenHIE","sidebar":"version-5.2.x/docs","previous":{"title":"MomConnect","permalink":"/openhim-docs/docs/implementations/momconnect"},"next":{"title":"Install on CentOS","permalink":"/openhim-docs/docs/how-to/install-on-centos"}}')}}]);